import { useState } from "react";
import ScreenHeading from "../../utilities/ScrennHeading/ScreenHeading";
import projectsJson from "../../../projects.json";

import "./Projects.css";

function Projects(props) {
  const [projects, setProjects] = useState(projectsJson);

  return (
    <div className="projects-container screen-container" id={props.id || ""}>
      <div className="projects-parent">
        <ScreenHeading title={"Projects"} subHeading={"My Projects"} />
        {projects.map(
          (project) => (
            <div className="projects--list">
            {project.name},
            {project.type},
            {project.language},
            {project.description},
            {project.link},
            <img src={project.image} width={200} alt="No Connection"></img>
            </div>
          )
        )}
      </div>
    </div>
  );
}

export default Projects;
